import React from "react";

const Dashboard = () => {
  return (
    <div className="flex">
      {/* Left Side */}
      <div className="w-2/3 p-4">
        <div className="mb-4">
          {/* Graph */}
          <div className="h-40 bg-gray-200 rounded-lg"></div>
        </div>

        <div className="flex mb-4">
          {/* Total Income */}
          <div className="w-1/2 mr-2 p-4 bg-white rounded-lg shadow">
            <h2 className="text-lg font-semibold mb-2">Total Income</h2>
            <div className="h-20 bg-gray-200 rounded-lg"></div>
          </div>

          {/* Total Expenses */}
          <div className="w-1/2 ml-2 p-4 bg-white rounded-lg shadow">
            <h2 className="text-lg font-semibold mb-2">Total Expenses</h2>
            <div className="h-20 bg-gray-200 rounded-lg"></div>
          </div>
        </div>

        {/* Total Balance */}
        <div className="p-4 bg-white rounded-lg shadow text-center">
          <h2 className="text-lg font-semibold mb-2">Total Balance</h2>
          <div className="h-20 bg-gray-200 rounded-lg"></div>
        </div>
      </div>

      {/* Right Side */}
      <div className="w-1/3 p-4">
        <div className="mb-4">
          {/* Recent History */}
          <div className=" mr-2 p-4 bg-white rounded-lg shadow">
            <h2 className="text-lg font-semibold mb-2">Recent History</h2>
            <div className="h-40 bg-gray-200 rounded-lg"></div>
          </div>
        </div>

        <div className="mb-4">
          {/* Min. Salary and Max Salary */}
          <div className=" mr-2 p-4 bg-white rounded-lg shadow">
            <h2 className="text-lg font-semibold mb-2">Salary</h2>
            <div className="h-20 bg-gray-200 rounded-lg"></div>
          </div>
        </div>

        <div>
          {/* Min. Expense and Max Expense */}
          <div className=" mr-2 p-5 bg-white rounded-lg shadow">
            <h2 className="text-lg font-semibold mb-2">Expense</h2>
            <div className="h-20 bg-gray-200 rounded-lg"></div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
